import { useParams } from "react-router-dom";



class Detailuser extends React.Component {
    componentDidMount() {
        let { id } = useParams();
        this.fetchData(id);
    }

    render() {
        let { id } = useParams();
        console.log(id);
        return (
            <>
                <h1>Hello detailuser:</h1>
            </>
        )
    }
}

// export default Home
export default Detailuser
